import React from 'react'

export default function Members({ members, showModal }){
    return (members.map((member) => {
        return( 
        <div key={member.id} id="div-container">

            <button onClick={showModal}>
              <p>{member.login}</p>
              <img src={member.avatar_url} />
            </button>
        </div>);
    }));
}
